import React from 'react';
import '../App.css';
import Form from "./Form";
import Weather from "./Weather";
import {Col, Container, Row} from "react-bootstrap";

function Containers() {
    return (
        <Container>
            <h1 className="center">Weather App</h1>
            <Row>
                <Col>
                    <Form/>
                </Col>
            </Row>
            <Row>
                <Weather/>
            </Row>
        </Container>
    );
}

export default Containers;
